import './App.css';
import Home from './Components/Home'
import Header from './Components/Header'
import Footer from './Footer'

function App() {
   return (

    <div className='app'>
      <Router>
        <Header/>

        <Switch>
          <Route path=''>
            <SearchPage />
          </Route>

        </Switch>

      <Footer/>
      </Router>


    </div>
  );
}


export default App;
